defaults:
  envsh: /opt/mapping_tools_builds/2016.05.11/setup.sh
  mapserv: /opt/mapping_tools_builds/2016.05.11/bin/mapserv
  timeout: 3600
  maps:
    unused: no_such_map
configs:
  "/basemap":
    projections:
      default: "osm-basemap.map"
      3338: "osm-basemap.alaska.map"
      4326: "osm-basemap.map"
      3857: "osm-basemap.google.map"
      900913: "osm-basemap.google.map"
      3572: "osm-basemap.alaska_polar.map"
      3573: "osm-basemap.alaska_polar.map"
      3574: "osm-basemap.alaska_polar.map"
      3575: "osm-basemap.alaska_polar.map"
      3576: "osm-basemap.alaska_polar.map"
  "/overlay":
    projections:
      default: "osm-ol.map"
      3338: "osm-ol.alaska.map"
      4326: "osm-ol.map"
      3857: "osm-ol.google.map"
      900913: "osm-ol.google.map"
      3572: "osm-ol.alaska_polar.map"
      3573: "osm-ol.alaska_polar.map"
      3574: "osm-ol.alaska_polar.map"
      3575: "osm-ol.alaska_polar.map"
      3576: "osm-ol.alaska_polar.map"
  "/no_labels":
    projections:
      default: "osm-ol-nl.map"
      3338: "osm-ol-nl.alaska.map"
      4326: "osm-ol-nl.map"
      3857: "osm-ol-nl.google.map"
      900913: "osm-ol-nl.google.map"
      3572: "osm-ol-nl.alaska_polar.map"
      3573: "osm-ol-nl.alaska_polar.map"
      3574: "osm-ol-nl.alaska_polar.map"
      3575: "osm-ol-nl.alaska_polar.map"
      3576: "osm-ol-nl.alaska_polar.map"
  "/osm":
    projections:
      default: "osm.map"
